\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</p><p class=\"x_xmsonormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Ante todo, muchas gracias por el espacio en la reunión y presentar los resultados.</p><p class=\"x_xmsonormal\" aria-hidden=\"true\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</p><p class=\"x_xmsonormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Como resultado de esta, les solicitamos por favor realizar las siguientes modificaciones en el documento técnico.</p><p class=\"x_xmsonormal\" aria-hidden=\"true\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</p><ol type=\"1\" start=\"1\" style=\"margin-bottom: 0cm; margin-top: 0cm;\"><li class=\"x_xmsolistparagraph\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Sobre los Hallazgos #1, #2, #3, #4, #7, teniendo en cuenta que se trata de debilidades en el uso del protocolo TLS, les solicitamos unificar la cantidad de hallazgos, utilizando el criterio que crean necesario.</li><li class=\"x_xmsolistparagraph\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Sobre el resultante de Hallazgos del punto 1, les solicitamos calificar la severidad en un nivel medio ya que el dispositivo ofrece varias alternativas de cifrados robustos y la complejidad del ataque es alta.</li><li class=\"x_xmsolistparagraph\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Por favor detallar en el Hallazgo #8 cuales son los encabezados de seguridad al que se encuentran ausentes.</li><li class=\"x_xmsolistparagraph\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">En el Hallazgo #10 se evidencia la exposición awds.<span data-markjs=\"true\" class=\"markslpclyjyk\" data-ogac=\"\" data-ogab=\"\" data-ogsc=\"\" data-ogsb=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit;\">bna</span>.com.ar/DeviceManagement/Enrollment/, teniendo en cuenta que es el sitio de acceso vía dispositivos móviles, se solicita quitar la evidencia.</li><li class=\"x_xmsolistparagraph\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Dentro de las Conclusiones, en las recomendaciones (3er viñeta), les solicitamos quitar el protocolo SSLv3 ya que el mismo no se encuentra habilitado.</li></ol><p class=\"x_xmsonormal\" aria-hidden=\"true\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</p><p class=\"x_xmsonormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Contamos con sus recomendaciones para realizar los cambios planteados.</p><p class=\"x_xmsonormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Cualquier duda estamos en contacto.</p><p class=\"x_xmsonormal\" aria-hidden=\"true\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</p><p class=\"x_xmsonormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">Saludos.</p><p class=\"x_xmsonormal\" aria-hidden=\"true\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\">&nbsp;</p><div style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit;\"><p class=\"x_xmsonormal\" style=\"margin: 0cm; font-size: 11pt; font-family: Calibri, sans-serif;\"><span data-ogsc=\"black\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 10pt; line-height: inherit; font-family: Arial, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 0px; padding: 0px; vertical-align: baseline;\">Santiago Plá</span></p><p class=\"x_xmsonormal\" style=\"margin: 0cm; 