será por email, copiando a los destinatarios de esta minuta.</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt; direction: ltr; margin-top: 0px; margin-bottom: 0px;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">Prevemos durante la semana que viene obtener la documentación necesaria de ambas partes (ver en pendientes).&nbsp;</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt; direction: ltr; margin-top: 0px; margin-bottom: 0px;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">Adjuntamos Carta de Autorización para ser completada con el detalle de las IPs a alcanzar.</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt; direction: ltr; margin-top: 0px; margin-bottom: 0px;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">De acuerdo al alcance final, se propondrá un cronograma de tareas.</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">El servicio se brindará en dos etapas: primero el pentest externo, incluyendo su informe, y luego el pentest interno en sede del cliente.</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">Una vez cumplimentados los pendientes, se confirmará fecha de inicio de la primer etapa.</div></li></ul></ul><div aria-hidden=\"true\" data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 11pt; line-height: inherit; font-family: Calibri, Helvetica, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 0px; padding: 0px; vertical-align: baseline; direction: ltr;\">&nbsp;</div><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 11pt; line-height: inherit; font-family: Calibri, Helvetica, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 0px; padding: 0px; vertical-align: baseline; direction: ltr;\">Pendientes&nbsp;</div><ul style=\"direction: ltr; margin-right: 0px; margin-bottom: 0px;\"><ul style=\"direction: ltr;\"><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt; direction: ltr; margin-top: 0px; margin-bottom: 0px;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">El cliente debe completar la información detallada sobre alcance en la Carta de Autorización adjunta, y remitirla a Telecom firmada.&nbsp;</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">Telecom debe remitir listado de personas involucradas en el proyecto para formularios de confidencialidad.</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">Telecom enviará para el cronograma propuesto, según el alcance final solicitado, para la aprobación del cliente.</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">Cliente remitirá formularios de confidencialidad para que el equipo de Telecom devuelva firmados.</div></li><li data-ogsc=\"rgb(0, 0, 0)\" style=\"font-family: Calibri, Helvetica, sans-serif; font-size: 11pt;\"><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\">Telecom remitirá documentos de ART y SVO de pentesters que asistirán a las oficinas de&nbsp;<span data-markjs=\"true\" class=\"markkra0c95kh\" data-ogac=\"\" data-ogab=\"\" data-ogsc=\"\" data-ogsb=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit;\">SENASA</span>.</div><div data-ogsc=\"\" style=\"border: 0px; font: inherit; margin: 0px; padding: 0px; vertical-align: baseline; color: inherit; direction: ltr;\"><br></div></li></ul></ul><div data-ogsc=\"rgb(0, 0, 0)\" style=\"border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: 11pt; line-height: inherit; font-family: Calibri, Helvetica, sans-serif; font-optical-sizing: inherit; font-size-adjust: inherit; font-kerning: inherit; font-feature-settings: inherit; font-variation-settings: inherit; margin: 0px; padding: 0px; vertical-align: baseline; direction: ltr;\">&nbsp;</div></blockquote></div></blockquote></blockquote></blockquote></div></blockquote></div></blockquote></div></blockquote>', 'NUEVO', 4, '2025-02-17 10:49:37', NULL, NULL, NULL, '3', 1),
