DELIMITER $$
CREATE TRIGGER `sincroniza_estados` AFTER UPDATE ON `tm_ticket` FOR EACH ROW BEGIN 
    IF NEW.estados_id <> OLD.estados_id THEN 
        SET @estado_nombre := (SELECT estados_nombre FROM tm_estados WHERE estados_id = NEW.estados_id); 
        UPDATE vulma_ops.Proyectos 
        SET idEstado = NEW.estados_id, estado = @estado_nombre 
        WHERE idVulmaGestion = NEW.tick_id; 
    END IF; 
END
$$
DELIMITER ;

